import React, {Component} from 'react';
import './App.css';
import { findDaysToShip } from './utils/util';
class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      products: []
    }
  }

  componentDidMount() {
    let url = "http://localhost:3002/products"
    fetch(url)
      .then(resp => resp.json())
      .then(data => {
        let products = data.map((product, index) => {
          return (
            <div className="box" key={index}>
              <h3>{product.productName}</h3>
              <h3>{product.inventoryQuantity}</h3>
              <h3>{ findDaysToShip(product).toDateString() }</h3>
            </div>
          )
        })
        this.setState({products: products});
      })
  }
  render() {
    return (
      <div className="App">
        {this.state.products}
      </div>
    );
  }
}

export default App;
